pub enum Member {

    #[doc = r" A named field like `self.x`."]
    Named(Ident),

    #[doc = r" An unnamed field like `self.0`."]
    Unnamed(Index),
}

pub enum BareFnArgName {

    #[doc = r" Argument given a name."]
    Named(Ident),

    #[doc = r" Argument not given a name, matched with `_`."]
    Wild(crate::token::Underscore),
}
